import './i18n/config';  // This should already be at the top
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

// Import your pages
import Home from './pages/Home';
import LoginPage from './pages/LoginPage';  // Use LoginPage, not Login
import DFUDashboard from './pages/DFUDashboard';
import DFUDistrictConfig from './pages/DFUDistrictConfig';
import DFUFraudAlerts from './pages/DFUFraudAlerts';
import DFUReports from './pages/DFUReports';
import NBFCDashboard from './pages/NBFCDashboard';
import NBFCMarketplace from './pages/NBFCMarketplace';
import NBFCPortfolio from './pages/NBFCPortfolio';
import NBFCLoanProducts from './pages/NBFCLoanProducts';
import NBFCProfile from './pages/NBFCProfile';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<LoginPage />} />
        
        <Route path="/dfu/dashboard" element={<DFUDashboard />} />
        <Route path="/dfu/district-config" element={<DFUDistrictConfig />} />
        <Route path="/dfu/fraud-alerts" element={<DFUFraudAlerts />} />
        <Route path="/dfu/reports" element={<DFUReports />} />
        
        <Route path="/nbfc/dashboard" element={<NBFCDashboard />} />
        <Route path="/nbfc/marketplace" element={<NBFCMarketplace />} />
        <Route path="/nbfc/portfolio" element={<NBFCPortfolio />} />
        <Route path="/nbfc/loan-products" element={<NBFCLoanProducts />} />
        <Route path="/nbfc/profile" element={<NBFCProfile />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
